import React from 'react'
import "../cssFiles/Goals.css";
import img2 from "../Images/tanu.png";
export default function Goals() {
  return (
    <div>
      <h1 className='goals'>Sustainable Goals</h1>
      <img src={img2} alt="" />
    </div>
  )
}
